import React from "react";
import Info from "./Info";
import Img from "../../Image/suraj.jpg";
import Style from "../Home/Home.m";
const About = () => {
  return (
    <div>
      <h2>About</h2>
      <div>
        <Info />
        <div className={Style["home_avatar"]}>
          <img src={Img} alt="avatar" />
        </div>
      </div>
    </div>
  );
};

export default About;
